import React from "react";

function Note(props) {
  function handleClick() {
    props.delete(props.title);
  }
  return (
    <div className="note">
      <h1>{props.title}</h1>
      <p>{props.content}</p>
      <button onClick={handleClick}>DELETE</button>
      <i class="bi bi-trash3-fill">DELETE</i>
    </div>
  );
}

export default Note;
